//import Tables from '../table/table.js'
import TableCard from '../table/TableCard.js';



const WidgetsDropdown = lazy(() => import('../widgets/WidgetsDropdown.js'))

const columns = [
  {
    dataField: "name",
    text: "Product Name",

  },
  {
    dataField: "price",
    text: "Price",

    sort: true
  },
  {
    dataField: "stock",
    text: "Stock",

  },
  {
    dataField: "origin",
    text: "Origin",

  },
  {
      dataField: "Action",
      text: "Action",

    }
];

const products = [
  {
    name: "apple",
    price: 100,
    stock: 10,
    origin: "japan",
    Action:<button>Delete</button>

  },
  {
    name: "orange",
    price: 150,
    stock: 456,
    origin: "spain",
    Action:"<button>Delete</button>"
  },
  {
    name: "pineapple",
    price: 300,
    stock: 4,
    origin: "america",
    Action:"<button>Delete</button>"
  }
];
const Dashboard = () => {
  return (
    <>
      <WidgetsDropdown />
      <div className="container card">


      <TableCard columns={columns} products={products}/>
      </div>

    </>
  )
}

export default Dashboard
